//Globals
var videoURLs = new Array(
        "https://media.w3.org/2010/05/sintel/trailer.mp4",
        "http://media.w3.org/2010/05/bunny/movie.mp4",
        "http://media.w3.org/2010/05/video/movie_300.webm",
        "http://media.w3.org/2010/05/bunny/trailer.mp4",
        "http://clips.vorwaerts-gmbh.de/VfE_html5.mp4"
        );
        var videoCount = 0;
        var boolSelect=false;
        var lastVideoSelectedID="";
        var listOfVideosToBeEffected=[];
        var totalListOfVideos=[];

function addSourceToVideo(element, src, type) {
    var source = document.createElement('source');
    source.src = src;
    source.type = type;
    element.appendChild(source);
}


function select(video, boolSelect){
    console.log("select; video id: "+video.id);
    if(!video||!boolSelect){
        console.log("no video, or not selection")
        return;
    }
    
    if(video.style.border==="thin dotted red"){
        var index = listOfVideosToBeEffected.indexOf(video);
        listOfVideosToBeEffected.splice(index, 1);
        video.style.border="";
    }else{
        listOfVideosToBeEffected.push(video);        
        video.style.border="thin dotted red";
    }
    console.log(listOfVideosToBeEffected);
}

function checkList(){
        if(listOfVideosToBeEffected[0]==='undefined'){
            console.log("no list");
            alert('Select a video to adjust, or do an all video commands.');
            
            document.getElementById("instructions").innerHTML="<font color='red'><p>You have not selected a video to adjust! Make sure to use the select gesture command than click on the videos you want to adjust.</p></font>";
            
            
            return false;
        }else{
            return true;
        }
}

function containAll(name){
    
    var n = name.search("All");
        if(n===-1){
            return false;
        }else{
            return true;
        }        
}

function script(name){
    
    
    //Check if warning. Then remove it if it exists.
    var warning = document.getElementById('warning');
    if(warning!==null){
        document.getElementById('warning').remove();
        document.getElementById('color-warning').remove();
    }
    
    warning= document.getElementById('max');
    
    if(warning!==null){
        document.getElementById('max-warning').remove();
        document.getElementById('max-color-warning').remove()
    }
    
    boolSelect=false;
    
    if(totalListOfVideos.length===0&&name!=="New Video"){
        document.getElementById("instructions").innerHTML="<font id='color-warning' color='red'><p id='warning'>You have no videos to adjust! Make sure to add a video before adjusting or selecting!</p></font>";
        
    }
    
   
    //Doesn't contain "all" and listOfVideosToBeEffected.length===0
    if(!containAll(name)&&listOfVideosToBeEffected.length===0&&name!=="New Video"&&name!=="select"){
        //alert('need to select a video to effect it. or use the all gesture to effect all videos.')
        document.getElementById("instructions").innerHTML="<font id='color-warning' color='red'><p id='warning'>You have not selected a video to adjust! Make sure to use the select gesture command than click on the videos you want to adjust.</p></font>";
            
        return;
    }
    
    
    
       
    if (name === "New Video"){
        var video = document.createElement('video');
        videoCount++;
        video.id = "video" + videoCount;
        video.height = 200;
        video.width = 200;
        video.onclick = function () { select(this, boolSelect) };
        totalListOfVideos.push(video);
        document.getElementById('videos').appendChild(video);
        try{
                addSourceToVideo(video, videoURLs[videoCount - 1], "video/" + videoURLs[videoCount - 1].split('.').pop());
                //addCheckBox(videoCount);
                video.play();
        } catch (e){
            console.log('caught network error', e);
    }

    }else if(name==="select"){
        console.log("select set to true");
        boolSelect=true;
    }
    
    if (name === "Remove Video"&&checkList()){  
        //console.log(totalListOfVideos);
        //console.log(listOfVideosToBeEffected);
        for(var i = 0; i<listOfVideosToBeEffected.length;i++){
            var index = totalListOfVideos.indexOf(listOfVideosToBeEffected[i]);
            totalListOfVideos.splice(index, 1);
            
            listOfVideosToBeEffected[i].remove();
            videoCount--;
        }
        listOfVideosToBeEffected=[];
        //console.log(totalListOfVideos);
        //console.log(listOfVideosToBeEffected);
    } else if (name === "Remove All Videos"){
        console.log("remove all: "+ videoCount);
        
        for(var i = 0; i<totalListOfVideos.length; i++){
            totalListOfVideos[i].remove();      
        }
        totalListOfVideos=[];
        videoCount = 0;
        
    } else if (name === "Play/Pause"&&checkList()){
        for(var i = 0; i<listOfVideosToBeEffected.length;i++){
            var myVideo= listOfVideosToBeEffected[i];
            if (myVideo.paused) {
                myVideo.play();
            } else {
                myVideo.pause();
            }
        }
    } else if (name === "Play/Pause All Videos"){
        for (var i = 0; i < totalListOfVideos.length; i++) {
        var myVideo = totalListOfVideos[i];
            if (myVideo.paused) {
                myVideo.play();
            } else {
                myVideo.pause();
            }
        }
    } else if (name === "Mute"){
        for (var i = 0; i < listOfVideosToBeEffected.length; i++) {
            var myVideo = listOfVideosToBeEffected[i];
            myVideo.muted = true;
        }
    } else if (name === "Mute All Videos"){
        for (var i = 0; i < totalListOfVideos.length; i++) {
            var myVideo = totalListOfVideos[i];
            myVideo.muted = true;
        }
    } else if (name === "Beginning of Video"){
        for (var i = 0; i < listOfVideosToBeEffected.length; i++) {
            var myVideo = listOfVideosToBeEffected[i];
            myVideo.currentTime = 0;
        }
    } else if (name === "Beginning of All Videos"){
        for (var i = 0; i < totalListOfVideos.length; i++) {
            var myVideo = totalListOfVideos[i];
            myVideo.currentTime = 0;
        }
    } else if (name === "Unmute"){
        for (var i = 0; i < listOfVideosToBeEffected.length; i++) {
            var myVideo = listOfVideosToBeEffected[i];
            myVideo.muted = false;
        }
    } else if (name === "Unmute All Videos"){
        for (var i = 0; i < totalListOfVideos.length; i++) {
            var video = totalListOfVideos[i];
            if(video.muted)
                video.muted = false;
        }
    } else if (name === "Middle of Video"){
        for (var i = 0; i < listOfVideosToBeEffected.length; i++) {
            var video = listOfVideosToBeEffected[i];
            var mid = video.duration / 2;
            video.currentTime = mid;
        }
    } else if (name === "Middle of All Videos"){
        for (var i = 0; i < totalListOfVideos.length; i++) {
            var video = totalListOfVideos[i];
            var mid = video.duration / 2;
            video.currentTime = mid;
        }
    
    } else if (name === "Increase Height"){
        for (var i = 0; i < listOfVideosToBeEffected.length; i++) {
            var video = listOfVideosToBeEffected[i];
            var videoHeight = video.height;
            if (videoHeight <= 500) {
                video.height += 100;
            } else {
                //alert('max height. video' + i);
                document.getElementById("instructions").innerHTML="<font id='max-color-warning' color='red'><p id='max-warning'>You have reached the maximum height for a selected video</p></font>";
        
            }
        }
    } else if (name === "Increase Height for All Videos"){
        for (var i = 0; i < totalListOfVideos.length; i++) {
            var video = totalListOfVideos[i];
            var videoHeight = video.height;
            if (videoHeight <= 500) {
                video.height += 100;
            } else {
                //alert('max height. video' + i);
                document.getElementById("instructions").innerHTML="<font id='max-color-warning' color='red'><p id='max-warning'>You have reached the maximum height for a selected video</p></font>";
        
            }
        }
    } else if (name === "Decrease Height"){
        for (var i = 0; i < listOfVideosToBeEffected.length; i++) {
            var video = listOfVideosToBeEffected[i];
            video.height -= 100;
        }
    } else if (name === "Decrease Height for All Videos"){
        for (var i = 0; i < totalListOfVideos.length; i++) {
            var video = totalListOfVideos[i];
            video.height -= 100;
        }
    } else if (name === "Increase Width"){
        for (var i = 0; i < listOfVideosToBeEffected.length; i++) {
            var video = listOfVideosToBeEffected[i];
            var videoWidth = video.width;
            if (videoWidth <= 800) {
                video.width += 100;
            } else {
                //alert('max width. video' + i);
                document.getElementById("instructions").innerHTML="<font id='max-color-warning' color='red'><p id='max-warning'>You have reached the maximum width for a selected video</p></font>";
        
            }
        }
    } else if (name === "Increase Width for All Videos"){
        for (var i = 0; i < totalListOfVideos.length; i++) {
            var video = totalListOfVideos[i];
            var videoWidth = video.width;
            if (videoWidth <= 800) {
                video.width += 100;
            } else {
                //alert('max width. video' + i);
                document.getElementById("instructions").innerHTML="<font id='max-color-warning' color='red'><p id='max-warning'>You have reached the maximum width for a selected video</p></font>";
        
            }
        }
    } else if (name === "Decrease Width"){
        for (var i = 0; i < listOfVideosToBeEffected.length; i++) {
            var video = listOfVideosToBeEffected[i];
            video.width -= 100;
        }
    } else if (name === "Decrease Width for All Videos"){
        for (var i = 0; i < totalListOfVideos.length; i++) {
            var video = totalListOfVideos[i];
            video.width -= 100;
        }
    } else if (name === "Increase Speed"){
        for (var i = 0; i < listOfVideosToBeEffected.length; i++) {
            var video = listOfVideosToBeEffected[i];
            video.playbackRate += .4;
        }
    } else if (name === "Increase Speed for All Videos"){
        for (var i = 0; i < totalListOfVideos.length; i++) {
            var video = totalListOfVideos[i];
            video.playbackRate += .4;
    }

    } else if (name === "Decrease Speed"){
        for (var i = 0; i < listOfVideosToBeEffected.length; i++) {
            var video = listOfVideosToBeEffected[i];
            video.playbackRate -= .4;
            }
    } else if (name === "Decrease Speed for All Videos"){
        for (var i = 0; i < totalListOfVideos.length; i++) {
            var video = totalListOfVideos[i];
            video.playbackRate -= .4;
        }
    
    } else if (name === "Increase Volume"){
        for (var i = 0; i < listOfVideosToBeEffected.length; i++) {
            var video = listOfVideosToBeEffected[i];
            if(video.volume<1)
                video.volume += .1;
        }
    } else if (name === "Increase Volume for All Videos"){
        for (var i = 0; i < totalListOfVideos.length; i++) {
            var video = totalListOfVideos[i];
            if(video.volume<1)
                video.volume += .1;
        }
    } else if (name === "Decrease Volume"){
        for (var i = 0; i < listOfVideosToBeEffected.length; i++) {
            var video = listOfVideosToBeEffected[i];
            if(video.volume>0)
                video.volume -= .1;
        }
    } else if (name === "Decrease Volume for All Videos"){
        for (var i = 0; i < totalListOfVideos.length; i++) {
            var video = totalListOfVideos[i];
            if(video.volume>0)
                video.volume -= .1;
        }
    }
}

